            if (!Directory.Exists(Path.GetDirectoryName(YouTubeContentPath)))
            {
                Directory.CreateDirectory(Path.GetDirectoryName(YouTubeContentPath));
            }

            SSSHF.Write(YouTubeContentPath, GetYouTubeContent(Video, Playlist));
        }

